import './App.css';

function App() {
  return (
    <div>
      <div>
      <Routes>
        <Route path={'/'} element={<Login/>}></Route>
        <Route path={'/signup'} element={<Signup/>}></Route>
        <Route path={'/blogs'} element={<Main child={<Blogs/>}/>}></Route>
        <Route path={'/add'} element={<Main child={<AddBlog/>}/>}></Route>
      </Routes>
    </div>
    </div>
  );
}

export default App;
